import { createRouter } from 'Common/bundle';

const Correcting = createRouter({
	load: () =>
		import('./container/correcting')
});


export default {
	  title: '作业模块',
	  path: '/',
		routes: [
			{
				title: '作业',
				path: '/correcting',
				component: Correcting
			}]
	}
